	@Inject
	public DbdTextEditorGrammarAccess(GrammarProvider grammarProvider,
			TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pDbdModel = new DbdModelElements();
		this.pMenu = new MenuElements();
		this.pChoice = new ChoiceElements();
		this.pRecordtype = new RecordtypeElements();
		this.pField = new FieldElements();
		this.pFieldattribute = new FieldattributeElements();
		this.eMenunames = new MenunamesElements();
		this.eChoicenames = new ChoicenamesElements();
		this.eRecordtypenames = new RecordtypenamesElements();
		this.eFieldnames = new FieldnamesElements();
		this.eDbfnames = new DbfnamesElements();
		this.eFieldattributenames = new FieldattributenamesElements();
		this.tSL_COMMENT = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "org.csstudio.xtext.dbdtexteditor.DbdTextEditor.SL_COMMENT");
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("org.csstudio.xtext.dbdtexteditor.DbdTextEditor".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	
	
	public TerminalsGrammarAccess getTerminalsGrammarAccess() {
		return gaTerminals;
	}

	
